import React from "react";
import { Routes, Route } from "react-router-dom";
import { Main, Planner } from ".../Components";

function App() {

	return (
		<div className='App'>
			<Routes>
				<Route path='/' element={<Main/>}/>
				<Route path='/planner' element={<Planner/>}/>
			</Routes>
		</div>
	);
}

export default App;
